import { Facebook, GitHub, Instagram, LinkedIn, Twitter, YouTube } from "@material-ui/icons";
import React from "react";
import Typical from "react-typical";
import "./profile.css";
import "../../../";

function Profile() {
  return (
    <div class="px-4 bg-move" style={{
      backgroundImage: `url("assets/images/n2.jpg")`,
    }}>
      <div class="row gx-5" >
        <div class="col-6">
          <div class="p-3 profile-container">
            <div className="profile-details-name mb-2">
              <apan className="primary-text ">
                {" "}
                HEY THERE ! <span className="im"> I'M </span>
              </apan>
            </div>

            <div className="profile-details-role">
              <span className="primary-text">
                {" "}
                <p className="profile-text">
                  {" "}
                  <Typical
                    loop={Infinity}
                    steps={[
                      "Mohd Nafees",
                      2000,
                      "Web Developer",
                      2000,
                      // "Python Developer",
                      // 1000,
                      // "Django Developer",
                      // 1000,
                      // "Django Rest Framework Developer",
                      // 1000,
                      // "React.js Developer",
                      // 1000,
                    ]}
                  />
                </p>
                <span className="profile-role-tagline">
                  Builging unique web applications with front and back end in
                  various technologies.
                </span>
              </span>
            </div>

            <div className="link-icons mt-3 text-center">
                <a href="/">
                <Facebook />
                </a>
                <a href="/">
                <Instagram />
                </a>
                <a href="/">
                <LinkedIn />
                </a>
                <a href="/">
                <Twitter />
                </a>
                <a href="/">
                <YouTube / >
                </a>
                <a href="/">
                <GitHub / >
                </a>
            </div>

            <div className="profile-options text-center mt-3">
              {/* <button className="btn ">
                {""}
                Hire Me{" "}
              </button> */}
              <a href="Nafees resume.pdf" download="mohd_nafees_cv.pdf">
                <button className="btn myResume"> Get Resume</button>
              </a>
            </div>

          </div>
        </div>
        <div class="col-6">
          <div class="p-3">
          <div className="profile-image">
                <div className="inner-profile-box">
                    <div className=""
                        //   style={{
                        //     backgroundImage: `url("assets/images/images.jpg 14")`,
                        //     backgroundRepeat: "no-repeat",
                        //     width: "90%",
                        //     // height: "600px",
                        //     backgroundSize: "cover",
                        //   }}
                    >
                    <img src="assets/images/images.jpg 14" alt="" className="rounded-circle z-depth-2 sideimage"/>
                    </div>
                </div>
            </div>
          </div>

          <div className="right-link-icons mt-3 text-center">
                <a href="/">
                <Facebook />
                </a>
                <a href="/">
                <Instagram />
                </a>
                <a href="/">
                <LinkedIn />
                </a>
                <a href="/">
                <Twitter />
                </a>
                <a href="/">
                <YouTube / >
                </a>
                <a href="/">
                <GitHub / >
                </a>
            </div>

            <div className="right-profile-options text-center mt-3">
              {/* <button className="btn ">
                {""}
                Hire Me{" "}
              </button> */}
              <a href="Nafees resume.pdf" download="mohd_nafees_cv.pdf">
                <button className="btn myResume"> Get Resume</button>
              </a>
            </div>

        </div>
      </div>
    </div>

    // <div className="profile-container">
    //   <div className="profile-parent row mt-5">
    //     <div className="col-6">
    //         <div className="profile-details">
    //             <div className="colz">
    //                 <div className="colz-icon">

    //                 </div>
    //             </div>

    //             <div className="profile-picture">
    //                 <div className="profile-picture-background"></div>
    //             </div>
    //         </div>
    //     </div>

    //     <div className="col-6 mt-5" >
    //     </div>

    //   </div>
    // </div>

  );
}

export default Profile;
